static void printTotalxNumbersSeq3(int N, const Word& w, size_t strand_a, size_t strand_b) {
  {
    int total = 0;
    std::vector<std::vector<int>> result(N, vector<int>(N, 0));
    Permutation p1(N);
    Permutation p2(N);


    int i = 0;
    std::cout << "ListPlot[{";
    for (const auto let : w) {
      const auto ind = std::abs(let);

      auto a = p2[ind - 1];
      auto b = p2[ind];
      p1.change(a, b);
      p2.change(ind - 1, ind);
      if (a < b) {
        std::swap(a, b);
      }

      if (i != 0) {
        std::cout << ",";
      }

      std::cout << "{" << i << "," << total << "}";

      const auto old_val = std::abs(result[a][b]);

      result[a][b] += (let < 0 ? -1 : 1);

      if (old_val < std::abs(result[a][b])) {
        total++;
      } else {
        total--;
      }
      ++i;
    }
    std::cout << "}]" << std::endl;
  }

  {
    int total = 0;
    std::vector<std::vector<int>> result(N, vector<int>(N, 0));
    Permutation p1(N);
    Permutation p2(N);

    int i = 0;
    std::cout << "ListPlot[{";
    for (const auto let : w) {
      const auto ind = std::abs(let);

      auto a = p2[ind - 1];
      auto b = p2[ind];
      p1.change(a, b);
      p2.change(ind - 1, ind);
      if (a < b) {
        std::swap(a, b);
      }

      if (strand_a == b && strand_b == a) {
        std::cout << ",";
        std::cout << "{" << i << "," << total << "}";
      }

      const auto old_val = std::abs(result[a][b]);

      result[a][b] += (let < 0 ? -1 : 1);

      if (old_val < std::abs(result[a][b])) {
        total++;
      } else {
        total--;
      }
      ++i;
    }

    std::cout << "}]" << std::endl;
  }
}


